// --- LOGO CORPORATIVO INCRUSTADO ---
const UNITECNIC_LOGO_BASE64 = "data:image/png;base64,"; // Puedes poner tu logo en base64 aqu si quieres
 // --- PLANTILLAS PARA EXPORTACIN HTML (CLIENTE) ---
// --- PLANTILLAS PARA EXPORTACIN HTML (CLIENTE) REDISEADA ---
const getClientTemplate = (data) => {
  let obj = data;
  if (typeof obj === "string") {
    try { obj = JSON.parse(obj); } catch (e) { obj = {}; }
  }
  const meta = (obj && obj.meta) ? obj.meta : {};
  const tasks = Array.isArray(obj && obj.tasks) ? obj.tasks : [];

  const escapeHtml = (value) => String(value ?? "").replace(/[&<>"']/g, (ch) => {
    switch (ch) {
      case "&": return "&amp;";
      case "<": return "&lt;";
      case ">": return "&gt;";
      case '"': return "&quot;";
      case "'": return "&#39;";
      default: return ch;
    }
  });

  const normalizeDataImage = (value) => {
    if (!value) return "";
    const v = String(value).trim();
    if (v.startsWith("data:image/")) return v;
    return "data:image/png;base64," + v.replace(/^base64,?/i, "");
  };

  const formatFechaES = (iso) => {
    if (!iso) return "";
    const t = String(iso).trim();
    if (!/^\d{4}-\d{2}-\d{2}$/.test(t)) return t;
    const [yyyy, mm, dd] = t.split("-");
    return `${dd}-${mm}-${yyyy}`;
  };

  const total = tasks.length;
  const completed = tasks.filter(t => String(t.estado).toLowerCase().includes("completado")).length;
  const inProgress = tasks.filter(t => String(t.estado).toLowerCase().includes("curso")).length;
  const pending = total - completed - inProgress;
  const pct = total ? Math.round((completed * 100) / total) : 0;

  const statusClass = (s) => {
    const k = String(s || "").toLowerCase();
    if (k.includes("completado")) return "st st-completed";
    if (k.includes("curso")) return "st st-inprogress";
    return "st st-pending";
  };

    // IMPORTANTE: No reordenar las tareas al exportar. Mantener el orden actual (incluye reordenacin por drag&drop).
  const tasksSorted = [...tasks];
const clientLogo = normalizeDataImage(meta.clientLogoData);
  const title = escapeHtml(meta.titulo || "Informe de Proyecto");
  const subtitle = escapeHtml(meta.subtitulo || "");
  const generatedAt = new Date().toLocaleString("es-ES");

  const renderSubtasks = (t) => {
    if (!t.subtasks || !t.subtasks.length) return "";
    return '<div style="margin-top:6px;border-top:1px solid #eee;padding-top:4px;">' + 
      t.subtasks.map(s => {
        const icon = s.done ? "" : "";
        const st = s.done ? "text-decoration:line-through;color:#999;" : "";
        return `<div style="font-size:11px;${st}">${icon} ${escapeHtml(s.text)}</div>`;
      }).join("") + 
    '</div>';
  };
  
  const rowsHtml = tasksSorted.map((t) => `
    <tr>
      <td class="col-area">${escapeHtml(t.area)}</td>
      <td class="col-task">${escapeHtml(t.tarea)}</td>
      <td class="col-status"><span class="${statusClass(t.estado)}">${escapeHtml(t.estado)}</span></td>
      <td class="col-details">${escapeHtml(t.detalles || "")}${renderSubtasks(t)}</td>
      <td class="col-date">${escapeHtml(formatFechaES(t.fechaInicio))}</td>
      <td class="col-date">${escapeHtml(formatFechaES(t.fechaLimite))}</td>
    </tr>`).join("");

  return `<!doctype html>
<html lang="es">
<head>
<meta charset="utf-8" />
<title>${title}</title>
<style>
  :root { --brand: #0888C8; --text: #1a1a1a; --muted: #64748b; --border: #e2e8f0; }
  body { font-family: -apple-system, system-ui, sans-serif; color: var(--text); background: #f1f5f9; margin: 0; padding: 40px 20px; }
  .card { max-width: 1100px; margin: 0 auto; background: #fff; border-radius: 24px; box-shadow: 0 20px 50px rgba(0,0,0,0.08); overflow: hidden; border: 1px solid var(--border); }
  
  /* CABECERA PROFESIONAL */
  .header { display: flex; justify-content: space-between; align-items: center; padding: 40px; background: #fff; border-bottom: 1px solid #f1f5f9; }
  .header-left { display: flex; align-items: center; gap: 30px; }
  .logo-client { height: 65px; max-width: 200px; object-fit: contain; }
  .logo-unitecnic { height: 45px; }
  h1 { margin: 0; font-size: 32px; font-weight: 800; letter-spacing: -0.03em; color: #111; }
  .subtitle { color: var(--muted); font-size: 16px; margin-top: 4px; font-weight: 500; }
  .gen-date { color: #94a3b8; font-size: 12px; margin-top: 12px; text-transform: uppercase; letter-spacing: 0.05em; }

  /* PANEL DE ESTADSTICAS (KPIs) */
  .stats-grid { display: grid; grid-template-columns: repeat(4, 1fr); gap: 20px; padding: 30px 40px; background: #f8fafc; border-bottom: 1px solid var(--border); }
  .kpi-card { background: #fff; padding: 20px; border-radius: 16px; border: 1px solid var(--border); box-shadow: 0 4px 6px rgba(0,0,0,0.02); }
  .kpi-label { font-size: 11px; font-weight: 700; color: var(--muted); text-transform: uppercase; letter-spacing: 0.05em; }
  .kpi-value { font-size: 28px; font-weight: 800; margin-top: 8px; color: var(--brand); }

  /* BARRA DE PROGRESO */
  .prog-container { padding: 0 40px 30px; background: #f8fafc; }
  .prog-bar { height: 12px; background: #e2e8f0; border-radius: 10px; overflow: hidden; }
  .prog-fill { height: 100%; width: ${pct}%; background: linear-gradient(90deg, #0888C8, #0ea5e9); border-radius: 10px; }
  .prog-text { display: flex; justify-content: space-between; margin-top: 10px; font-size: 13px; font-weight: 600; color: var(--muted); }

  /* TABLA DE TRABAJOS */
  table { width: 100%; border-collapse: collapse; table-layout: fixed; }
  th { background: #fff; text-align: left; padding: 18px 20px; font-size: 11px; color: #94a3b8; border-bottom: 2px solid #f1f5f9; text-transform: uppercase; letter-spacing: 0.05em; }
  td { padding: 20px; border-bottom: 1px solid #f8fafc; font-size: 14px; vertical-align: middle; word-wrap: break-word; }
  tr:last-child td { border-bottom: none; }
  
  /* ESTADOS (PLDORAS) */
  .st { display: inline-flex; align-items: center; justify-content: center; min-width: 110px; padding: 6px 12px; border-radius: 8px; font-size: 10px; font-weight: 800; text-transform: uppercase; border: 1px solid; }
  .st-completed { background: #f0fdf4; color: #166534; border-color: #bbf7d0; }
  .st-inprogress { background: #fffbeb; color: #92400e; border-color: #fef08a; }
  .st-pending   { background: #fef2f2; color: #991b1b; border-color: #fecaca; }

  @media print {
    body { background: #fff; padding: 0; }
    .card { border: none; box-shadow: none; max-width: 100%; }
    .header { padding: 20px 0; border-bottom: 2px solid #000; }
    .stats-grid { padding: 20px 0; background: #fff; }
    .prog-container { padding: 0 0 20px; background: #fff; }
    th { border-bottom: 1px solid #000; color: #000; }
  }
</style>
</head>
<body>
  <div class="card">
    <div class="header">
      <div class="header-left">
        ${clientLogo ? `<img class="logo-client" src="${clientLogo}" />` : ''}
        <div>
          <h1>${title}</h1>
          ${subtitle ? `<div class="subtitle">${subtitle}</div>` : ''}
          <div class="gen-date">Informe de Seguimiento  ${generatedAt}</div>
        </div>
      </div>
      <img class="logo-unitecnic" src="${UNITECNIC_LOGO_BASE64}" />
    </div>

    <div class="stats-grid">
      <div class="kpi-card"><div class="kpi-label">Estado General</div><div class="kpi-value">${pct}%</div></div>
      <div class="kpi-card"><div class="kpi-label">Tareas OK</div><div class="kpi-value">${completed}</div></div>
      <div class="kpi-card"><div class="kpi-label">En Curso</div><div class="kpi-value">${inProgress}</div></div>
      <div class="kpi-card"><div class="kpi-label">Pendientes</div><div class="kpi-value">${pending}</div></div>
    </div>

    <div class="prog-container">
      <div class="prog-bar"><div class="prog-fill"></div></div>
      <div class="prog-text">
        <span>Progreso del proyecto</span>
        <span>${completed} de ${total} tareas finalizadas</span>
      </div>
    </div>

    <table>
      <thead>
        <tr>
          <th style="width:15%">rea</th>
          <th style="width:20%">Tarea</th>
          <th style="width:15%">Estado</th>
          <th style="width:30%">Detalles</th>
          <th style="width:10%">Inicio</th>
          <th style="width:10%">Lmite</th>
        </tr>
      </thead>
      <tbody>${rowsHtml}</tbody>
    </table>
  </div>
</body>
</html>`;
};